1001 challenge – уникальная платформа - магазин виртуальных спортивных челленджей. 

В начальной версии - бег, далее добавятся велосипед, лыжи, горные лыжи и т д, с фантастическими призами по итогам челленджа. Чем больше и успешнее участвовать в мероприятиях на платформе, тем больше баллов можно набрать и больше призов выиграть, а при достижении отметки в 1001 балл – КАЖДЫЙ участник получит денежный приз – 1001 EURO.

Разные уровни участия – и три варианта побед: 
-	выиграй приз в текущем челлендже, выполнив его быстрее других;
-	выиграй приз в лотерею (каждый участник, выполнивший челлендж и загрузивший свой результат на платформу, автоматически становится участником лотереи);
-	набери 1001 балл суммарно по итогам разных челленджей и получи гарантированный денежный приз – 1001 евро.

Схема прохождения челленджей: 
-	загрузи приложение (доступно для скачивания в Apple Store);
-	зарегистрируйся на платформе;
-	зарегистрируйся в одном или нескольких открытых челленджах, на одной или несколько дистанциях;
-	выполни тренировку по выбранной дисциплине – в любой день (с момента открытия и до закрытия челленджа) и в любое время, в любом городе и стране;
-	загрузи тренировку в приложение с помощью прямой синхронизации с трекером Strava *;
* Результат автоматически появится в рейтингах текущего челленджа. Рейтинги открытого челленджа являются предварительными и информация в них будет меняться по мере добавления новых участников и загрузки новых результатов, вплоть до даты закрытия челленджа.

-	дождись окончания челленджа и подведения результатов **.
** По окончанию челленджа в заявленный день в 23:59:59 регистрация закрывается, дальнейшая загрузка результатов невозможна, рейтинги фиксируются и в приложении формируется список участников в соответствии с временем прохождения дистанции. 

За каждое призовое место полагаются замечательные призы, 
(Классификация победителей по полу в рамках каждой дистанции – призы отдельно для мужчин и для женщин);
за места с 1 по 10 – дополнительные баллы в рейтинге;
а также все участники, приславшие результаты, получают баллы за участие***. 

*** Если участник зарегистрировался в челлендже, но не выполнил его или не загрузил результат – его баллы за участие обнуляются.

Призовые места для каждого челленджа описаны в приложении.

Для участия в челлендже необходимо на него зарегистрироваться. Для регистрации в челлендже необходимо выбрать один из семи тарифов и выбрать дистанции. Один бесплатный тариф  "One Try" дает возможность зарегистрироваться на одну дистанцию челлнджа и дает возможность загрузить результат только один раз.  При выборе тарифа категории Unlimited можно загружать каждую новую тренировку, которая лучше предыдущей, тем самым улучшая свою позицию в рейтинге. Тарифы категории Unlimited отличаются число дистанций, на которые ты сможешь зарегистрироваться.

Оплата тарифа категории Unlimited выполняется в приложении, банковской картой, используя встроенную платежную систему. Все преимущества оплаченного распространяются только на один челлендж и на период действия челленджа. 

По мере прохождения разных челленджей твои баллы будут суммироваться и формировать рейтинг проекта 1001 challenge. Самое главное – они не сгорают и не обнуляются. Даже если будет перерыв в тренировках – всегда можно вернуться и продолжить набирать баллы ровно с того уровня, на каком ты остановился.

Платформа 1001 challenge соединяет спорт и путешествия, челленджи посвящены определенной стране/направлению, призами в нем являются ночи в отелях данной страны/направления, футболки и другая атрибутика, отражающая символику направления, а также скидки на участие в следующих челленджах.

Участие в челленджах доступно для всех возрастов и для любого уровня физической подготовки. Для того, чтобы набрать 1001 балл – не обязательно каждый раз побеждать и занимать 1 место, достаточно принимать участие как в можно большем количестве челленджей. 

Компания Apple не является спонсором и никоем образом не участвует в розыгрыше призов.
